import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './RestaurantOwnerDashboard.css';
import { useNavigate } from 'react-router-dom';

const RestaurantOwnerDashboard = () => {
  const [profileData, setProfileData] = useState(null);
  const [showProfilePanel, setShowProfilePanel] = useState(false);
  const [showAddCategoryPanel, setShowAddCategoryPanel] = useState(false);
  const [newCategory, setNewCategory] = useState({ foodCategoryName: '', restaurantId: '' });
  const [categoryAddedMessage, setCategoryAddedMessage] = useState('');
  const navigate = useNavigate();
  
  const userId = localStorage.getItem('userId'); 

  useEffect(() => {
    if (showProfilePanel) {
      axios.get(`http://localhost:100/users/profile/${userId}`)
        .then(response => {
          setProfileData(response.data);
        })
        .catch(error => {
          console.error("There was an error fetching the profile!", error);
        });
    }
  }, [showProfilePanel, userId]);

  const handleMyProfileClick = () => {
    setShowProfilePanel(!showProfilePanel);
  };

  const handleAddCategoryClick = () => {
    setShowAddCategoryPanel(!showAddCategoryPanel);
    setCategoryAddedMessage(''); // Clear the success message when opening the form
  };

  const handleCategoryChange = (e) => {
    setNewCategory({ ...newCategory, [e.target.name]: e.target.value });
  };

  const handleCategorySubmit = (e) => {
    e.preventDefault();

    axios.post('http://localhost:100/categories/addFoodCategory', newCategory)
      .then(response => {
        setCategoryAddedMessage('Category added successfully!');
        setNewCategory({ foodCategoryName: '', restaurantId: '' }); // Clear form after successful submission
      })
      .catch(error => {
        console.error("There was an error adding the category!", error);
      });
  };

  const handleNavigation = (path) => {
    navigate(path, { state: { userId: userId } });
  };

  return (
    <div className="owner-dashboard-container">
      <nav className="navbar">
        <div className="navbar-left">Restaurant Owner Dashboard</div>
        <div className="navbar-right">
          <button onClick={() => handleNavigation('/')}>Home</button>
          <button onClick={() => handleNavigation('/logout')}>Logout</button>
        </div>
      </nav>

      <aside className="sidebar">
        <h3>Actions</h3>
        <button onClick={handleMyProfileClick}>My Profile</button>
        <button onClick={() => handleNavigation('/addRestaurant')}>Add Restaurant</button>
        <button onClick={() => handleNavigation('/viewAllRestaurants')}>My Restaurants</button>
        <button onClick={handleAddCategoryClick}>Add Category</button>
        <button onClick={() => handleNavigation('/viewFoodItem')}>Food Menu</button>
      </aside>

      <div className="content">
        {showProfilePanel && (
          <div className={`profile-panel ${showProfilePanel ? 'visible' : ''}`}>
            {profileData && (
              <div className="profile-details">
                <h2>Profile Information</h2>
                <p><strong>Name:</strong> {`${profileData.firstName} ${profileData.lastName}`}</p>
                <p><strong>Email:</strong> {profileData.email}</p>
                <p><strong>Phone Number:</strong> {profileData.phoneNo}</p>
                <p><strong>Role:</strong> {profileData.role}</p>
              </div>
            )}
          </div>
        )}

        {showAddCategoryPanel && (
          <div className={`add-category-panel ${showAddCategoryPanel ? 'visible' : ''}`}>
            <h2>Add New Category</h2>
            <form onSubmit={handleCategorySubmit}>
              <div>
                <label>Category Name:</label>
                <input
                  type="text"
                  name="foodCategoryName"
                  value={newCategory.foodCategoryName}
                  onChange={handleCategoryChange}
                  required
                />
              </div>
              <div>
                <label>Restaurant ID:</label>
                <input
                  type="text"
                  name="restaurantId"
                  value={newCategory.restaurantId}
                  onChange={handleCategoryChange}
                  required
                />
              </div>
              <button type="submit">Add Category</button>
            </form>
            {categoryAddedMessage && <p className="success-message">{categoryAddedMessage}</p>}
          </div>
        )}
      </div>
    </div>
  );
};

export default RestaurantOwnerDashboard;
